    protected function validate($data, $rules)
    {
        $validate = Validator::make(
            $data,
            $rules
        );

        if ($validate->fails()) {
            var_export($validate->errors()->getMessages());
            throw new \Exception('表单验证未通过');
        }

        return true;
    }

